import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import Select from "react-select"; // Import React-Select
import ButtonDanger from "./ButtonDanger";
import image5 from "./image-5.png";
import f1LapSimulator from "./Image0.png";
import image6 from "./image-6.png";
import image7 from "./image-7.png";
import rectangle6 from "./rectangle-6.svg"; // Import rectangle-6.svg
import rectangle5 from "./rectangle-5.png"; // Import rectangle-5.png
import "./style.css";

export const LandingPage = () => {
  const navigate = useNavigate();

  const handleNavigateToAbout = () => {
    navigate("/about");
  };

  const handleResetApp = () => {
    window.location.reload();
  };

  // Options for dropdowns
  const options = [
    { value: "option1", label: "Option 1" },
    { value: "option2", label: "Option 2" },
    { value: "option3", label: "Option 3" },
  ];

  // State for selected options
  const [selectedOption1, setSelectedOption1] = useState(null);
  const [selectedOption2, setSelectedOption2] = useState(null);
  const [selectedOption3, setSelectedOption3] = useState(null);

  return (
    <div className="landing-page">
      <div className="overlap-wrapper">
        <div className="overlap">
          <div className="overlap-group">
            {/* Navigation Section */}
            <div className="navigation">
              <div className="div">
                <div className="text-wrapper">f1-lap-predictor</div>

                {/* White background surrounding image-5 */}
                <div className="image-wrapper">
                  <div className="image-5-background">
                    <img
                      className="image-5-button"
                      alt="Reset App"
                      src={image5}
                      onClick={handleResetApp}
                      style={{ cursor: "pointer" }}
                    />
                  </div>
                </div>
              </div>
            </div>

            {/* Dropdowns Section */}
            <div className="dropdowns-container">
              <Select
                className="dropdown"
                options={options}
                value={selectedOption1}
                onChange={setSelectedOption1}
                placeholder="Select Option 1"
              />
              <Select
                className="dropdown"
                options={options}
                value={selectedOption2}
                onChange={setSelectedOption2}
                placeholder="Select Option 2"
              />
              <Select
                className="dropdown"
                options={options}
                value={selectedOption3}
                onChange={setSelectedOption3}
                placeholder="Select Option 3"
              />
            </div>

            {/* Image0 restored */}
            <div className="copy">
              <div className="page-title" />
              <img
                className="LAP-SIMULATOR"
                alt="Lap SIMULATOR"
                src={f1LapSimulator}
              />
            </div>

            {/* Rectangle-5 restored */}
            <img className="rectangle-5" alt="Rectangle" src={rectangle5} />

            {/* Rectangle-6 restored */}
            <img className="rectangle-6" alt="Output Display" src={rectangle6} />

            {/* Image-6 at the center */}
            <img className="image-6-center" alt="Center Image" src={image6} />

            {/* ButtonDanger restored and centrally aligned */}
            <div className="button-container">
              <ButtonDanger
                className="button-danger-instance"
                divClassName="design-component-instance-node"
                label="GO"
                size="medium"
                variant="primary"
              />
            </div>

            {/* Image-7 for navigation */}
            <img
              className="image-7-button"
              alt="Navigate to About Page"
              src={image7}
              onClick={handleNavigateToAbout}
              style={{ cursor: "pointer" }}
            />
          </div>
        </div>
      </div>
    </div>
  );
};
